class User {
  User({
    String? id,
    String? name,
    String? username,
    String? email,
    String? apiKey,
    String? roleCode,
    bool? active,
    String? authToken,
    List<Units>? units,
    bool? isResident,
    List<Sites>? sites,
    List<Policy>? policy,
    bool? defaultPasswordChanged,
    String? passwordResetToken,
    Company? company,}) {
    _id = id;
    _name = name;
    _username = username;
    _email = email;
    _apiKey = apiKey;
    _roleCode = roleCode;
    _active = active;
    _authToken = authToken;
    _units = units;
    _isResident = isResident;
    _sites = sites;
    _policy = policy;
    _defaultPasswordChanged = defaultPasswordChanged;
    _passwordResetToken = passwordResetToken;
    _company = company;
  }

  User.fromJson(dynamic json) {
    _id = json['id'];
    _name = json['name'];
    _username = json['username'];
    _email = json['email'];
    _apiKey = json['api_key'];
    _roleCode = json['role_code'];
    _active = json['active'];
    _authToken = json['auth_token'];
    if (json['units'] != null) {
      _units = [];
      json['units'].forEach((v) {
        _units?.add(Units.fromJson(v));
      });
    }
    _isResident = json['is_resident'];
    if (json['sites'] != null) {
      _sites = [];
      json['sites'].forEach((v) {
        _sites?.add(Sites.fromJson(v));
      });
    }
    if (json['policy'] != null) {
      _policy = [];
      json['policy'].forEach((v) {
        _policy?.add(Policy.fromJson(v));
      });
    }
    _defaultPasswordChanged = json['default_password_changed'];
    _passwordResetToken = json['password_reset_token'];
    _company =
    json['company'] != null ? Company.fromJson(json['company']) : null;
  }

  String? _id;
  String? _name;
  String? _username;
  String? _email;
  String? _apiKey;
  String? _roleCode;
  bool? _active;
  String? _authToken;
  List<Units>? _units;
  bool? _isResident;
  List<Sites>? _sites;
  List<Policy>? _policy;
  bool? _defaultPasswordChanged;
  String? _passwordResetToken;
  Company? _company;

  User copyWith({ String? id,
    String? name,
    String? username,
    String? email,
    String? apiKey,
    String? roleCode,
    bool? active,
    String? authToken,
    List<Units>? units,
    bool? isResident,
    List<Sites>? sites,
    List<Policy>? policy,
    bool? defaultPasswordChanged,
    String? passwordResetToken,
    Company? company,
  }) =>
      User(
        id: id ?? _id,
        name: name ?? _name,
        username: username ?? _username,
        email: email ?? _email,
        apiKey: apiKey ?? _apiKey,
        roleCode: roleCode ?? _roleCode,
        active: active ?? _active,
        authToken: authToken ?? _authToken,
        units: units ?? _units,
        isResident: isResident ?? _isResident,
        sites: sites ?? _sites,
        policy: policy ?? _policy,
        defaultPasswordChanged: defaultPasswordChanged ??
            _defaultPasswordChanged,
        passwordResetToken: passwordResetToken ?? _passwordResetToken,
        company: company ?? _company,
      );

