  String? get apiKey => _apiKey;

  String? get roleCode => _roleCode;

  bool? get active => _active;

  String? get authToken => _authToken;

  List<Units>? get units => _units;

  bool? get isResident => _isResident;

  List<Sites>? get sites => _sites;

  List<Policy>? get policy => _policy;

  bool? get defaultPasswordChanged => _defaultPasswordChanged;

  String? get passwordResetToken => _passwordResetToken;

  Company? get company => _company;

