    final map = <String, dynamic>{};
    map['id'] = _id;
    map['name'] = _name;
    map['username'] = _username;
    map['email'] = _email;
    map['api_key'] = _apiKey;
    map['role_code'] = _roleCode;
    map['active'] = _active;
    map['auth_token'] = _authToken;
    if (_units != null) {
      map['units'] = _units?.map((v) => v.toJson()).toList();
    }
    map['is_resident'] = _isResident;
    if (_sites != null) {
      map['sites'] = _sites?.map((v) => v.toJson()).toList();
    }
    if (_policy != null) {
      map['policy'] = _policy?.map((v) => v.toJson()).toList();
    }
    map['default_password_changed'] = _defaultPasswordChanged;
    map['password_reset_token'] = _passwordResetToken;
    if (_company != null) {
      map['company'] = _company?.toJson();
